import React from "react";

function navBar() {
	return (
		<div>
			<nav>
				<div className="logo">DeepWebDevs</div>
				<a>Home</a>
				<a>About</a>
				<a>Projects</a>
			</nav>
		</div>
	);
}

export default navBar;
